import React from 'react';
import TodoListItem from './TodoListItem.js';

const TodoList = ( { todos } ) => {

  const elements = todos.map((item) => {
    return (
      <li>
        <TodoListItem label = {item.label}
        important = {item.important}/>
      </li>);
  });

  return (
    <ul>
      {elements}
    </ul>
  );
}

export default TodoList;
